(3, 5, '_form', '<section class=\"form-wrap\">\n	<div class=\"row\">\n		<div class=\"col-12 col-lg-6\">\n			<div class=\"form-group\">\n			<label> First Name *</label>\n			[text* first-name class:form-control] \n		</div>\n		</div>\n\n		<div class=\"col-12 col-lg-6\">\n			<div class=\"form-group\">\n			<label> Last Name *</label>\n			[text* last-name class:form-control] \n		</div>\n		</div>\n\n		<div class=\"col-12 col-lg-6\">\n			<div class=\"form-group\">\n			<label> Email *</label>\n			[email* your-email class:form-control] \n		</div>\n		</div>\n\n		<div class=\"col-12 col-lg-6\">\n			<div class=\"form-group\">\n			<label> Phone (inc country code)</label>\n			[tel your-phone class:form-control] \n		</div>\n		</div>\n\n		<div class=\"col-12\">\n			<div class=\"form-group\">\n		<label> Company/Business Name</label>\n		[text business-name class:form-control] \n		</div>\n		</div>\n\n		<div class=\"col-12 col-lg-4\">\n			<div class=\"form-group\">\n		<label> Est. Group Size</label>\n		[number group-size class:form-control] \n		</div>\n		</div>\n		<div class=\"col-12 col-lg-4\">\n			<div class=\"form-group\">\n		<label> Est. Budget (USD)</label>\n		[number budget id:event-budget class:form-control] \n		</div>\n		</div>\n		<div class=\"col-12 col-lg-4\">\n			<div class=\"form-group\">\n		<label> Event Date</label>\n		[text event-date id:event-date class:date-field class:form-control]\n		</div>\n		</div>\n\n		<div class=\"col-12\">\n			<div class=\"form-group\">\n		<label> Tell us more about your group (location, type, interests)</label>\n		[textarea your-message class:form-control placeholder \"Start typing...\"] \n		</div>\n		</div>\n		\n		<div class=\"col-12 text-right\">\n			<button type=\"submit\" class=\"btn btn-jump\">Submit</button>\n		</div>\n	</div>\n</section>'),
(4, 5, '_mail', 'a:9:{s:6:\"active\";b:1;s:7:\"subject\";s:22:\"Grupo \"[your-subject]\"\";s:6:\"sender\";s:46:\"[first-name] [last-name] <wordpress@grupo.loc>\";s:9:\"recipient\";s:14:\"test@gmail.com\";s:4:\"body\";s:229:\"From: [your-name] <[your-email]>\nSubject: [your-subject]\n\nMessage Body:\n[your-message]\n\n[your-phone]\n[business-name]\n[group-size]\n[budget]\n[event-date]\n\n-- \nThis e-mail was sent from a contact form on Grupo (http://grupo.loc:802)\";s:18:\"additional_headers\";s:22:\"Reply-To: [your-email]\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";b:0;s:13:\"exclude_blank\";b:0;}'),
