(355, 1, '2018-08-22 06:04:54', '2018-08-22 06:04:54', '<section class=\"form-wrap\">\r\n	<div class=\"row\">\r\n\r\n		<div class=\"col-12 text-center\">\r\n			<h2 class=\"layout-h1\">Send us an enquiry</h2>\r\n                        <p>Fill out the form below and one of our helpful staff will be in touch with you within 1 business day!</p>\r\n		</div>\r\n		<div class=\"col-12 col-lg-6\">\r\n			<div class=\"form-group\">\r\n			<label> First Name *</label>\r\n			[text* first-name class:form-control] \r\n		</div>\r\n		</div>\r\n\r\n		<div class=\"col-12 col-lg-6\">\r\n			<div class=\"form-group\">\r\n			<label> Last Name *</label>\r\n			[text* last-name class:form-control] \r\n		</div>\r\n		</div>\r\n\r\n		<div class=\"col-12 col-lg-6\">\r\n			<div class=\"form-group\">\r\n			<label> Email *</label>\r\n			[email* your-email class:form-control] \r\n		</div>\r\n		</div>\r\n\r\n		<div class=\"col-12 col-lg-6\">\r\n			<div class=\"form-group\">\r\n			<label> Phone (inc country code)</label>\r\n			[tel your-phone class:form-control] \r\n		</div>\r\n		</div>\r\n\r\n		<div class=\"col-12\">\r\n			<div class=\"form-group\">\r\n		<label> Company</label>\r\n		[text business-name class:form-control] \r\n		</div>\r\n		</div>\r\n\r\n		<div class=\"col-12\">\r\n			<div class=\"form-group\">\r\n		<label> Tell us more about your group (location, type, interests)</label>\r\n		[textarea your-message class:form-control placeholder \"Start typing...\"] \r\n		</div>\r\n		</div>\r\n		\r\n		<div class=\"col-12 text-right\">\r\n			<button type=\"submit\" class=\"btn btn-jump\">Submit</button>\r\n		</div>\r\n	</div>\r\n</section>\n1\nGrupo \"[first-name][last-name]\"\n[first-name][last-name] <wordpress@grupo.loc>\ntest@gmail.com\nFrom: [first-name] [last-name] <[your-email]>\r\nSubject: [your-subject]\r\n\r\nMessage Body:\r\n[your-message]\r\n[your-email]\r\n[your-phone]\r\n[business-name]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on Grupo (http://grupo.loc:802)\nReply-To: [your-email]\n\n\n\n\nGrupo \"[your-subject]\"\nGrupo <wordpress@grupo.loc>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on Grupo (http://grupo.loc:802)\nReply-To: test@gmail.com\n\n\n\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.\nThe date format is incorrect.\nThe date is before the earliest one allowed.\nThe date is after the latest one allowed.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nThe number format is invalid.\nThe number is smaller than the minimum allowed.\nThe number is larger than the maximum allowed.\nThe answer to the quiz is incorrect.\nYour entered code is incorrect.\nThe e-mail address entered is invalid.\nThe URL is invalid.\nThe telephone number is invalid.', 'Send us an enquiry', '', 'publish', 'closed', 'closed', '', 'send-us-an-enquiry', '', '', '2018-08-22 06:20:01', '2018-08-22 06:20:01', '', 0, 'http://grupo.loc:802/?post_type=wpcf7_contact_form&#038;p=355', 0, 'wpcf7_contact_form', '', 0),
