(466, 1, '2018-08-24 12:38:04', '2018-08-24 12:38:04', '<h2>Reward, inspire and forge bonds within your team with a one of a kind team building experience in Mexico! Discover how we help companies of all sizes build healthy, productive and more connected teams through our innovative and fun team building activities!</h2>\r\nCompany culture doesnât happen over night; however, this is a good start! Take the next step by exploring our most popular team building activities below and contact us for a custom proposal specific to your group!\r\n\r\n&nbsp;\r\n<h3>Why choose us?</h3>\r\n<strong>Weâre reliable.</strong> We have a strong track record of success with a wide range of groups and companies. Our experienced team of event coordinators and creative directors will work with you to find the solution that best fits your groups needs. We take the time to listen to your priorities and then provide the perfect solution to fit your individual group dynamics.\r\n\r\n<strong>Weâre flexible.</strong> Like a yoga instructor! We can create custom events with a special theme, specific time frame, group dynamic, or unique location. We also cater to a wide range of budgets depending on your needs.\r\n\r\n<strong>Weâre dedicated.</strong> We understand that you are busy and you need information quickly. We can handle short lead times and often provide solutions at a momentâs notice when you need it most. You will see fast, quality results when you partner with us.\r\n\r\n<strong>Weâre bilingual.</strong> Our team building activities are available in English or Spanish anywhere in Mexico.\r\n\r\n<strong>Weâre responsive.</strong> We are able to immediately produce a professional group activity proposal that meets your needs. We realize that you often require details now, not a week from now. We respect that and will work smarter to get you an innovative team building concept ready to present!', 'Team Building', '', 'inherit', 'closed', 'closed', '', '11-revision-v1', '', '', '2018-08-24 12:38:04', '2018-08-24 12:38:04', '', 11, 'http://grupo.loc:802/2018/08/24/11-revision-v1/', 0, 'revision', '', 0),
